Starring: Andy San Dimas, Stoya, Sabrina Taylor, Manuel Ferrara, Erik Everhard, James Deen
Sometimes Good Girls Are Anything But...
The ultra-sexy Stoya is about to shake things up. Her sister, Andy San Dimas thinks Stoya is innocent and uncorrupted. What Andy doesn't know is that behind closed doors, Stoya is an insatiable deviant. roommate Erik Everhard is the first to succumb to Stoya after easily being duped. He hopes he as enough left in the tank to go right back at it with his main squeeze, Sabrina Taylor. Even Brooklyn Lee gets aroused just by being around the erotic muse and ravishes Andy's boyfriend Manuel Ferrara in a fiery fuck scene that leaves them both breathless. Pizza delivery boy James Deen fulfills his wildest fantasy when on a 'run' he encounters Stoya, whose idea of a tips is opening up for Anal Sex. No one can resist the undercover bad girl on the block! Stoya redefines sex in unSEXpected!
